import Nav from '../Nav/Nav';
import './App.css';

class App extends Component {
  render() {
      return (
          <div className="App">
              <Navbar dark color="primary">
              <div className="container">
                  <NavbarBrand href="/">Mico</NavbarBrand>
              </div>
              </Navbar>
          </div>
      );
  }
}

export default App;
